import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';

export default function LogenHome() {

    const [userCount, setUserCount] = useState(0);

  useEffect(() => {
    const fetchUserCount = async () => {
      const response = await axios.get('http://localhost:8080/users/count');
      setUserCount(response.data);
    };

    fetchUserCount();
  }, []);

  return (
    <Container fluid>
      <Row className="py-3">
        <Col xs={3} className="bg-primary text-light p-3 justify-content-start">
          <h4>Friend list</h4>
        </Col>
        <Col xs={6} className="bg-secondary text-light p-3">
          <h4>Main screen</h4>
        </Col>
        <Col xs={3} className="bg-info text-light p-3 justify-content-end">
          <h4>Friend requests</h4>
        </Col>
      </Row>
      <Row className="bg-light pt-3 pb-2 rounded" style={{ margin: '10px 0', padding: '10px' }}>
  <Col xs={3} className="border border-secondary rounded text-start pe-3">
    <h5>Title 1</h5>
    <p>Content 1</p>
  </Col>
  <Col xs={6} className="border border-secondary rounded text-center pe-3">
    <h5>Title 2</h5>
    <p>Content 2</p>
  </Col>
  <Col xs={3} className="border border-secondary rounded text-end">
    <h5>Title 3</h5>
    <p>Content 3</p>
  </Col>
</Row>
    </Container>
  )
}
